import React, { Component } from "react";

class Skills extends Component {
    render() {
        return (
            <div id="skills">
                <h2>COMPETENCES</h2>
                <br></br><br></br>
                <h3>Back-End</h3>
                <p>Laravel</p>
                <p>Symfony</p>
                <p>PHP</p>
                <p>Node.JS</p>
                <br></br>
                <h3>Front-End</h3>
                <p>React</p>
                <p>jQuery</p>
                <p>Javascript</p>
                <p>HTML5</p>
                <p>CSS</p>
                <br></br>
                <h3>Database</h3>
                <p>MySQL</p>
                <p>MongoDB</p>
                <br></br><br></br>
            </div>
        );
    }
}

export default Skills;
